import "./MenuTabStyle.css"
import {Link} from "react-router-dom";


const MenuTab = (prop) => {


    return (
        <div>
            <ul class="menu">
                <li class="menu">
                    {" "}
                    <Link to="/products"> Products </Link>{" "}
                </li>
                <li class="menu">
                    {" "}
                    <Link to="/logout"> Log Out </Link>{" "}
                </li>
            </ul>
        </div>
    );
};

export default MenuTab;
